  false,\n\t\"url\": null,\n\t\"notes\": \"Fort Niobrara National Wildlife Refuge
  (FNNWR) is located on the Niobrara River in north central Cherry County, NE. There
  is little detailed information available documenting the vegetation of FNNWR. Tolstead
  (1942) studied the grasslands of northern Cherry County, (including FNNWR) with
  a focus on describing the dominant species of grassland types and determining the
  relationships between vegetation distribution and environmental variables and management
  practices. Churchill et al (1988) described the vascular flora of The Nature Conservancyu2019s
  nearby Niobrara Valley Preserve. Fiest et al (2010) conducted vascular plant surveys
  on portions of the FNNWR in 2009 and compiled a partial vascular plant species list
  for the refuge. The purposes of this study were to provide the following for FNNWR:
  1) an updated vascular plant species list, 2) definitions and descriptions of native
  plant communities, and 3) vegetation management recommendations.\",\n\t\"owner_org\":
